import React from 'react';
import { useLocation } from 'react-router-dom';
import AllRoutes from './routes/routes';
import './App.css';

function App() {
  const location = useLocation();
  const isLoginRoute = location.pathname === '/';

  return (
    <div className="App">
      {isLoginRoute ? (
        <AllRoutes />
      ) : (
        <AllRoutes />
      )}
    </div>
  );
}

export default App;
